body:
@venkat1m, I propose a single directory, a single Maven project, and a single jar for all the UDRs (SPJs and UDFs) that we ship with the Trafodion SQL engine.

When we added the library management SPJs, I was already concerned about having yet another Maven project file. I would really prefer if we could put all the SPJs built into Trafodion into a single Maven project, with a single jar. 

Note also that we need to move at least two more UDRs into that jar, EVENT_LOG_READER and JDBC. This is for security reasons.
